import React from "react";
import {Navbar, Nav} from "react-bootstrap";

const NavBar = () => {
    return (
        <Navbar bg="primary" variant="dark">
            <Nav className="mr-auto">
                <Nav.Link href="">Home</Nav.Link>
                <Nav.Link href="about">About</Nav.Link>
            </Nav>
        </Navbar>
    );
};

export default NavBar;
